import Link from 'next/link';
export const SeriesLits = ({ series }) => (
    <>
        <h2>Series</h2>
        <div className="channels">
            {series.map((serie) => (
                <Link href={`/channel?id=${serie.id}`} prefetch>
                    <a className="channel">
                        <img src={serie.urls.logo_image.original} alt="" />
                        <h2>{serie.title}</h2>
                    </a>
                </Link>
            ))}
        </div>
    </>
);
